function recognizeCSVContentAndPerform() {
    // 找到要填写的输入框
    let inputs = document.getElementsByClassName('el-input__inner')
    let check = document.getElementById('just_id')
    let justName = document.getElementById('just_name')
    let name_input = inputs[1]
    let id_num_input = inputs[2]

    let unfoundName = []

    let value = document.getElementById('csv_text').value
    let lines = value.split(/[(\r\n)\r\n]+/); // 根据换行或者回车进行识别
    lines.forEach((item, index) => { // 删除空项
        if (!item) {
            lines.splice(index, 1);
        }
    })
    lines = Array.from(new Set(lines));

    let count = 0
    let interval = setInterval(function () {
        if (count <= lines.length - 1) {
            let line = lines[count]
            if (line.includes(',') && !check.checked) {
                let arr = line.split(',')
                let name = arr[0]
                let id = arr[1]
                name_input.value = name
                id_num_input.value = id
                // 需要设置input事件才能正确输入值
                name_input.dispatchEvent(new Event('input'))
                id_num_input.dispatchEvent(new Event('input'))
                // 进行查询
                document.getElementsByClassName('el-button el-button--primary')[0].click()
                let btns = document.getElementsByClassName('el-button el-button--text')
                setTimeout(function () {
                    let content = document.body.textContent
                    let n = content.split(line).length - 1
                    if (n == 3) {
                        if (btns.length == 9) {
                            btns[7].click()
                            console.log(name + ' 已执行录取')
                        }
                    } else {
                        unfoundName.push(line)
                    }
                }, 350)

                count++ // 迭代
            } else if (check.checked) {
                if (isIdCard(line)) {
                    let id = line
                    id_num_input.value = id
                    id_num_input.dispatchEvent(new Event('input'))
                    document.getElementsByClassName('el-button el-button--primary')[0].click()
                    let btns = document.getElementsByClassName('el-button el-button--text')
                    setTimeout(function () {
                        if (btns.length == 9) {
                            btns[7].click()
                            console.log(name + ' 已执行录取')
                        }
                    }, 350)

                    count++ // 迭代
                } else {
                    toast.show('请输入正确的身份证号!')
                    clearInterval(interval)
                    return
                }
            } else if (justName.checked) {
                let name = line
                name_input.value = name
                name_input.dispatchEvent(new Event('input'))
                document.getElementsByClassName('el-button el-button--primary')[0].click()
                let btns = document.getElementsByClassName('el-button el-button--text')
                setTimeout(function () {
                    let content = document.body.textContent
                    let n = content.split(line).length - 1
                    if (n == 3) {
                        if (btns.length == 9) {
                            btns[7].click()
                            console.log(name + ' 已执行录取')
                        }
                    } else {
                        unfoundName.push(line)
                    }
                }, 350)

                count++ // 迭代
            } else {
                toast.show('请输入正确的备案信息!')
                clearInterval(interval)
                return
            }
        } else {
            if (unfoundName.length != 0) {
                alert('未找到: ' + unfoundName.join(',') + ', 其余均已录用完成')
            } else {
                toast.show('录用完成')
            }
            clearInterval(interval)
        }
    }, 850)
}

