function performHistoryEnlist() {
    let value = document.getElementById('id_texts').value
    let lines = value.split(/[(\r\n)\r\n]+/); // 根据换行或者回车进行识别
    lines.forEach((item, index) => { // 删除空项
        if (!item) {
            lines.splice(index, 1);
        }
    })
    lines = Array.from(new Set(lines));

    let count = 0
    let interval = setInterval(function () {
        if (count <= lines.length - 1) {
            if (lines.length == 0) {
                clearInterval(interval)
                toast.show('备案信息不能为空\n请输入正确的身份证号序列！')
            } else {
                let ln = lines[count]
                if (isIdCard(ln)) {
                    fn1(ln).then(fn2).then(fn3).then(fn4).then(fn5).then(res => {
                        count++
                    })
                } else {
                    clearInterval(interval)
                    toast.show("请输入正确的身份证号码！");
                }
            }
        } else {
            clearInterval(interval)
            toast.show('录用完成')
        }
    }, 2000)
}

